import React from "react";

const Nav = () => {
  return (
    <>
      <div className="Nav-Baar">
         <div className="nav_name">
            <h1 className="name">Shutter Up</h1>
         </div>
         <div className="nav_profile"></div>
      </div>
    </>
  );
};

export default Nav;
